function Footer() {
  return (
    <Container className="footer" fluid={true}>
      <Row >
        <Col xl={12}>
        Copyright Â© 2020-{(new Date().getFullYear())} <strong>Koa Devs</strong>,  <small>V1,1</small>
        </Col>
      </Row>
    </Container>
  );
}

export default Footer;
